The test checks the stack frame of `_Dmain` is in the backtrace, however if unused locals are optimised out and`test` is inlined into `main` 
```d
void test()
{
    int innerLocal = 20;
    throw new Exception("foo");
}
void main(string[] args)
{
    string myLocal = "bar";
    test();
}
```
then the point at which the untapped exception is thrown is at the start of D main - not somewhere in the middle of it - and so GDB prints 
```
...
#4 D main (args=...)
```
rather than 
```
...
#4 0xSOMEADDRESS in D main (args=...)
```

@schveiguy explained there is a thread-local cache that avoids a global lock once the cache is filled.
See https://github.com/dlang/dlang.org/pull/3445#discussion_r1002773401. 
Add link to spec (instead of capacity LREF which already exists just above Appender).

